import './App.css';
import React, { Component } from 'react';
import Ingredient from './pages/ingredientPage';
import HomePage from './pages/homePage';
import FreezeBee from './pages/freezebeePage';
import { BrowserRouter as Router, Switch, Route, NavLink, Link } from 'react-router-dom';
import Fabrication from './pages/fabricationPage';
import { Navbar, NavbarBrand, Container, Image } from 'react-bootstrap';
import Logo from './assets/logo.png';

class App extends Component {
  render() {
    return (
      <div className="h-100">
        <Router>
          <Navbar bg="dark" variant="dark">
            <Container>
              <Image src={Logo} alt="KillerBee" height="30" roundedCircle/>
              <NavbarBrand as={Link} to={'/'} className="nav-brand">KillerBee</NavbarBrand>
              <NavbarBrand as={Link} to={'/freezebee'} className="nav-link">
                FreezeBee
              </NavbarBrand>
              <NavbarBrand as={Link} to={'/fabrication'} className="nav-link">
                Procédé de fabrication
              </NavbarBrand>
              <NavbarBrand as={Link} to={'/ingredient'} className="nav-link">
                Ingrédient
              </NavbarBrand>
            </Container>
          </Navbar>
            <Switch>
              <Route exact path='/' component={HomePage} />
              <Route path='/ingredient' component={Ingredient} />
              <Route path='/freezebee' component={FreezeBee} />
              <Route path='/fabrication' component={Fabrication} />
            </Switch>
        </Router>
      </div>
    );
  }
}

export default App;
